function ManipulateSpreadsheet() {
    return (
      <div>
        <Navigation />
        <div>
          <header>
            <p>
                Here is the Manipulate Spreadsheet page!
            </p>
          </header>
        </div>
      </div>
    );
  }

  export default ManipulateSpreadsheet;
